        code: 11121, codeText: '11121', codeLength: 5, codeParent: '1112', title: 'Vegetable and Melon Farming', description: 'This industry comprises establishments primarily engaged in one or more of the following: (1) growing vegetable and/or melon crops; (2) producing vegetable and/or melon seeds; and (3) growing vegetable and/or melon bedding plants.  The crops included in this industry have an annual growth cycle and are grown in open fields.  Climate and cultural practices limit producing areas but often permit the growing of a combination of crops in a year.&#10;&#10;Cross-References. Establishments primarily engaged in--', status: 'Active',
