        code: 11141, codeText: '11141', codeLength: 5, codeParent: '1114', title: 'Food Crops Grown Under Cover', description: 'This industry comprises establishments primarily engaged in growing food crops (e.g., fruits, melons, tomatoes) under glass or protective cover.&#10;&#10;Cross-References.', status: 'Active',
