        code: 111421, codeText: '111421', codeLength: 6, codeParent: '11142', title: 'Nursery and Tree Production', description: 'This U.S. industry comprises establishments primarily engaged in (1) growing nursery products, nursery stock, shrubbery, bulbs, fruit stock, sod, and so forth, under cover or in open fields and/or (2) growing short rotation woody trees with a growth and harvest cycle of 10 years or less for pulp or tree stock.&#10;&#10;Cross-References. Establishments primarily engaged in--', status: 'Active',
