        code: 423460, codeText: '423460', codeLength: 6, codeParent: '42346', title: 'Ophthalmic Goods Merchant Wholesalers', description: 'This industry comprises establishments primarily engaged in the merchant wholesale distribution of professional equipment, instruments, and/or goods sold, prescribed, or used by ophthalmologists, optometrists, and opticians.&#10;&#10;Illustrative Examples:&#10;&#10;Binoculars merchant wholesalers&#10;Optometric equipment and supplies merchant wholesalers&#10;Ophthalmic frames merchant wholesalers&#10;Sunglasses merchant wholesalers&#10;Ophthalmic lenses merchant wholesalers&#10;', status: 'Active',
