        code: 423720, codeText: '423720', codeLength: 6, codeParent: '42372', title: 'Plumbing and Heating Equipment and Supplies (Hydronics) Merchant Wholesalers', description: 'This industry comprises establishments primarily engaged in the merchant wholesale distribution of plumbing equipment, hydronic heating equipment, household-type water heaters, and/or supplies.&#10;&#10;Cross-References. Establishments primarily engaged in--', status: 'Active',
