        code: 423740, codeText: '423740', codeLength: 6, codeParent: '42374', title: 'Refrigeration Equipment and Supplies Merchant Wholesalers', description: 'This industry comprises establishments primarily engaged in the merchant wholesale distribution of refrigeration equipment (except household-type refrigerators, freezers, and air-conditioners).&#10;&#10;Illustrative Examples:&#10;&#10;Cold storage machinery merchant wholesalers&#10;Refrigerated display cases merchant wholesalers&#10;Commercial refrigerators merchant wholesalers&#10;Water coolers merchant wholesalers&#10;&#10;&#10;Cross-References. Establishments primarily engaged in--', status: 'Active',
